Defendant in custody on WRIT.
On count 1, defendant is sentenced to the Wisconsin State Prison System for a total of two (2) years.  That is one (1) year initial confinement followed by one (1) year extended supervision.  To run concurrent with the sentences imposed on 14 CF 323 and 12 CF 206.
On count 3, defendant is sentenced to the Wisconsin State Prison System for a total of two (2) years and six (6) months.  That is one (1) year initial confinement followed by one (1) year and six (6) months extended supervision.  To run concurrent with count 1 of this case as well as the sentences imposed on 14 CF 323 and 12 CF 206.
The Court finds the defendant not eligible for either the Challenge Incarceration Program or the Substance Abuse Program.
Conditions of extended supervision:
1) pay court costs;
2) pay supervision fees;
3) maintain absolute sobriety;
4) no contact with the victims or anyone under the age of 18 unless approved by the agent;
5) comply with Sex Offender Registry as directed by statute;
6) assessment, treatment, counseling as deemed appropriate by the Department's assessment process.
